import React from 'react'
import ReactDOM from 'react-dom'

import Header from './components/header/header.component'
import Content from './components/content/conent.component'
import Total from './components/total/total.component'




const App = () => {
    const course = 'Half Stack application development';

    const part1 = {
        name: 'Fundamentals of React',
        exercises: 10
    };
    const part2 = {
        name: 'Using props to pass data',
        exercises: 7
    };
    const part3 = {
        name: 'State of a components',
        exercises: 14
    };



    return (
        <div>
            <Header course={course}/>
            <Content part1={part1.name} part2={part2.name} part3={part3.name} exercises1={part1.exercises} exercises2={part2.exercises} exercises3={part3.exercises}/>
            <Total exercises1={part1.exercises} exercises2={part1.exercises} exercises3={part1.exercises}/>

        </div>
    )
};

ReactDOM.render(<App />, document.getElementById('root'));
